svg.script:
function abar(id) {
  var bar = document.getElementById(id);
  bar.setAttribute('opacity', '1.0');
  var model = bar.getElementsByClassName('model')[0];
  if (model != undefined) {
    model.setAttribute('opacity', '1.0');
  }
}

function dbar(id) {
  var bar = document.getElementById(id);
  bar.setAttribute('opacity', '0.15');
  var model = bar.getElementsByClassName('model')[0];
  if (model != undefined) {
    model.setAttribute('opacity', '0.0');
  }
}
